import React from "react";

const Footer = () => {
    return (
        <div>
            <ul>
                <li>Фильмы</li>
                <li>Мультфильмы</li>
                <li>Игры</li>
                <li>Порно</li>
            </ul>
        </div>
    );
}

export default Footer;
